Сдается новая 3-х комнатная квартира со свежим евро ремонтом, мебелью и бытовой техникой в новом жилом доме «Кожомкул+». Удобное расположение (самый центр), в непосредственной близости от сквера им.Горького, дворца спорта им.К.Кожомкула, филармонии им.Т.Сатылганова, многих БЦ и ТЦ города. Сам дом расположен по улице Коенкозова, общая площадь 129,7 кв м., этаж 5/12, не угловая, 2 сан.узлы.
В комплектацию квартиры включены следующие удобства:
- полностью оборудованная кухня;
- микроволновка, холодильник, эл.чайник;
- посуда;
- стиральная машина;
- пылесос;
- кондиционеры в 2-х комнатах;
- утюг;
- гладильный стол;
