Курящих и с животными не беспокойте пожалуйста.

NOVA CITY бизнес класстагы турак-жай кварталы Горький көчөсүндө Юнусалиев менен 7-апрель көчөлөрүнүн ортосунда жайгашкан.  Бул заманбап жана прогрессивдүү коом үчүн жаңы муундагы турак-жай кандай болушу керектиги жөнүндөгү идеяңызды өзгөртө турган объект.

 Кварталга жакын жерде жашоо үчүн зарыл болгон бардык имараттар жана уюмдар, оюн-зоок борборлору, спорт комплекстери жана диний мекемелер бар.

 Квартал инфраструктурасы өнүккөн аймакта жайгашкан, жалпы аянты чоң, узундугу 2,8 га, 14 квартал жана 1000ден ашык батирлүү.
 Турак жайдын артыкчылыктары:

 бай тышкы инфраструктурасы бар заманбап келечектүү аймак;
 1 сап;
 стилдүү архитектура жана имараттардын лаконикалык геометриясы;
 вентиляцияланган фарфор таштан жасалган фасад жана декоративдик гипс;
 монолиттүү темир-бетон каркас, дубалдарды кирпич менен толтуруу;
 борбордук коммуникациялар: суу менен камсыздоо, жылуулук, электр энергиясы, газдаштыруу, канализация;
 акылдуу үй башкаруу системасы: жабык корголгон аймак, видео байкоо системасы - телефондон башкаруу;  жүзүн таануу менен видео домофондор;
 жогорку ылдамдыктагы үнсүз лифттери Коне (элеваторлор үчүн генераторлор);
 жер астындагы жана коноктор үчүн токтоочу жай, токтоочу жайда электр унаалары үчүн розеткалар;
 батирлер аралык үн изоляциясы;
 коопсуз короо, функционалдык жактан балдар оюндары, активдүү спорттук (машыгуу), командалык оюндар (баскетбол, футбол, волейбол, стол тенниси), иш-чаралар (амфитеатр), сейилдөө жана эс алуу үчүн аймактарга бөлүнгөн;
